import React from 'react';
import { useNavigate } from "react-router-dom";
import { Box, Button, Typography } from "@mui/material";

const BlogPostPage = ({ title, date, readTime, content }) => {
    const navigate = useNavigate();

    return (
        <div className="blogpostpage">
            <h1>Blog</h1>
            <Box sx={{ padding: "24px", maxWidth: "800px", margin: "0 auto" }}>
                <Button
                    variant="outlined"
                    onClick={() => navigate("/blog")}
                    sx={{
                        display: "flex",
                        justifyContent: "flex-start",
                        marginBottom: "16px",
                        textTransform: "none",
                        padding: "8px 16px",
                    }}
                >
                    Back to Blog
                </Button>

                {/* Blog title */}
                <Typography
                    variant="h4"
                    component="h1"
                    sx={{ textAlign: "center", marginBottom: "8px" }}
                >
                    {title}
                </Typography>

                {/* Date and read time */}
                <Typography
                    variant="body1"
                    sx={{ textAlign: "center", color: "gray", marginBottom: "24px" }}
                >
                    {date} â€¢ {readTime} min read
                </Typography>

                {/* Blog content */}
                <Typography
                    variant="body1"
                    sx={{
                        textAlign: "justify",
                        lineHeight: "1.7",
                    }}
                >
                    {content}
                </Typography>

            </Box>
        </div>
    );
};

export default BlogPostPage;
